import React from 'react'
import animals from '../photos/animals.jpg';

const styles = {
    backgroundImage: `url(${animals})`,
    height: '100vh',
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'center',
    alignItems: 'center',
  };
  
  function Homepage() {
    return (
      <div style={styles}>
        <h1 className='display-1 text-center mb-5'>AniHelp</h1>
        <div className='d-flex'>
          <button className='btn btn-primary mr-3'>Login</button>
          <button className='btn btn-primary mr-3'>Sign up</button>
        </div>
      </div>
    );
  }
export default Homepage
